        [TestMethod, TestCategory("JSON")]
        public void JSONDeserializeSerialize_AreEqual()
        {
            var source = JSONExample0;
            var deserialized = Json.Deserialize<MinModel.Statuses>(source);
            var serialized = Json.Serialize(deserialized, true);
            Assert.AreEqual(serialized, source);
        }

        [TestMethod, TestCategory("JSON")]
        public void JSONDeserializeSearchTweets_GotText()
        {
            var deserialized = Json.Deserialize<MinModel.Statuses>(JSONExample4);
            Assert.IsTrue(!string.IsNullOrEmpty(deserialized.statuses[0].text) || !string.IsNullOrEmpty(deserialized.statuses[0].full_text));
        }

        [TestMethod, TestCategory("JSON")]
        public void JSONDeserializeUserTimeline_GotText()
        {
            var deserialized = Json.Deserialize<List<MinModel.Status>>(JSONExample5);
            Assert.IsTrue(!string.IsNullOrEmpty(deserialized[0].text) || !string.IsNullOrEmpty(deserialized[0].full_text));
        }

        [TestMethod, TestCategory("JSON")]
        public void JSONDeserializeStatusesShow_GotText()
        {
            var deserialized = Json.Deserialize<MinModel.Status>(JSONExample6);
            Assert.IsTrue(!string.IsNullOrEmpty(deserialized.text) || !string.IsNullOrEmpty(deserialized.full_text));
        }

        [TestMethod, TestCategory("JSON")]
        public void JSONSerializeStat_Correct()
        {
            var serialized = Json.Serialize(CharStat.GetStat("ab"), true);
            Assert.IsTrue(serialized == @"{""a"":0.5,""b"":0.5}" || serialized == @"{""b"":0.5,""a"":0.5}");
        }

        [TestMethod, TestCategory("JSON")]
        public void JSONSerializeStatModel1_Correct()
        {
            var serialized = Json.Serialize(CharStat.GetStatModel("abbb").AsOrderedDictionary(), true);
            Assert.IsTrue(serialized == @"{""b"":0.75,""a"":0.25}");
        }

        [TestMethod, TestCategory("JSON")]
        public void JSONSerializeStatModel2_Correct()
        {
            var serialized = Json.Serialize(CharStat.GetStatModel("abbb", true).AsOrderedDictionary(), true);
            Assert.IsTrue(serialized == @"{""a"":0.25,""b"":0.75}");
        }
               
